import asyncio
import httpx


async def gen_ms_token():
    request_headers = {
        'accept': 'application/json, text/plain, */*',
        'accept-language': 'zh-CN,zh;q=0.9',
        'cache-control': 'no-cache',
        'pragma': 'no-cache',
        'priority': 'u=1, i',
        'sec-ch-ua': '"Chromium";v="128", "Not;A=Brand";v="24", "Google Chrome";v="128"',
        'sec-ch-ua-mobile': '?0',
        'sec-ch-ua-platform': '"Windows"',
        'sec-fetch-dest': 'empty',
        'sec-fetch-mode': 'cors',
        'sec-fetch-site': 'same-site',
        'user-agent': "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/126.0.0.0 Safari/537.36 Edg/126.0.0.0",
    }

    request_url = "https://mssdk.bytedance.com/web/report"

    request_params =   {
        'magic': 538969122,
        'version': 1,
        'dataType': 8,
        'strData': '',
        "tspFromClient": 0,
        "ulr": 0,
    }

    async with httpx.AsyncClient() as client:
        response = await client.post(url=request_url,json=request_params, headers=request_headers)
        # print(response.headers)
        # print(response.headers.get("x-ms-token"))
    return response.headers.get("x-ms-token")
if __name__ == '__main__':
    asyncio.run(gen_ms_token())